import "./webpage.css"
import 'font-awesome/css/font-awesome.min.css';
import React from "react"
class Navi extends React.Component{
    render(){
        return(
            <div>
               <div>
               <i class="fa-sharp fa-regular fa-b"></i>
               <i class="fa-solid fa-bolt"></i>
               <i class="fa-solid fa-bolt"></i>
<h3>BAK-ONE</h3>
<p>one page</p>
               </div>
               <ul>
                <li>Home</li>
                <li>online payment</li>
                <li>About</li>
                <li>Contact</li>
               </ul>

            </div>
        )
    }
    
}
export default Navi;
